import React from "react";
import { Container, Row, Col } from "react-bootstrap";
import Navbar from "react-bootstrap/Navbar";
import Nav from "react-bootstrap/Nav";
import Button from "react-bootstrap/Button";

function Header() {
  return (
    <Navbar bg="dark" data-bs-theme="dark">
      {/* <Container> */}
        {/* <Row> */}
          <Col className="col-1 ">
          </Col>
          <Col className="col-10 ">
            <Nav className="me-auto d-flex justify-content-center">
              <Nav.Link href="#home" className="fw-bold">Home</Nav.Link>
              <Nav.Link href="#features" className="fw-bold">Store</Nav.Link>
              <Nav.Link href="#pricing" className="fw-bold">About</Nav.Link>

            </Nav>
          </Col>

          <Col className="col-1 d-flex justify-content-center "> 
          <Button variant="light" >Cart</Button>
          </Col>
        {/* </Row> */}
      {/* </Container> */}
    </Navbar>
  );
}

export default Header;
